    color: #e2e2e2 !important;
  }
  .AddQuestionFromHeaderDialogButton:hover, .submit_button:hover,
  .primary_button:hover, .MoreStoriesIndicator:hover {
    opacity: .8 !important;
  }
  /* text selection */
  ::selection {
    background-color: /*[[base-color]]*/ !important;
    color: #efefef !important;
